import "./Navbar.css";

 import React from 'react';
//import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <div className="header">
      <a href="/">
        <h1>Portfolio</h1>
      </a>
    </div>
  );
};

export default Navbar;
